import React, { useEffect, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { Bell } from 'lucide-react';

const StudentDashboard = () => {
  const navigate = useNavigate();
  const [showNotifications, setShowNotifications] = useState(false);
  const [notifications, setNotifications] = useState([
    { id: 1, message: "WARDEN APPROVED: Your Homepass application has been fully approved.", timestamp: "3/28/2025, 9:39:50 AM" },
    { id: 2, message: "DISCIPLINE SCORE UPDATED: Your discipline score has been updated to 100 by the warden.", timestamp: "3/28/2025, 9:39:44 AM" },
    { id: 3, message: "ADVISOR APPROVED: Your Outpass application has been approved by the advisor.", timestamp: "3/28/2025, 9:39:04 AM" },
    { id: 4, message: "PASS APPLICATION SUBMITTED: Your Outpass application has been submitted.", timestamp: "3/28/2025, 9:38:47 AM" },
    { id: 5, message: "DISCIPLINE SCORE UPDATED: Your discipline score has been updated to 100 by the warden.", timestamp: "3/28/2025, 9:54:54 AM" },
    { id: 6, message: "ADVISOR APPROVED: Your Homepass application has been approved by the advisor.", timestamp: "3/28/2025, 9:40:27 AM" },
    { id: 7, message: "PASS APPLICATION SUBMITTED: Your Homepass application has been submitted.", timestamp: "3/28/2025, 9:40:04 AM" },
  ]);

  useEffect(() => {
    const token = localStorage.getItem('token');
    const user = JSON.parse(localStorage.getItem('user'));
    if (!token || !user || user.role !== 'student') {
      navigate('/student/login');
    }
    // TODO: Fetch notifications from the backend
    // Example: axios.get('http://localhost:5000/api/notifications', { headers: { Authorization: `Bearer ${token}` } })
  }, [navigate]);

  const toggleNotifications = () => {
    setShowNotifications(!showNotifications);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/student/login');
  };

  return (
    <div className="particle-bg flex flex-col min-h-screen">
      <nav className="fixed top-0 left-0 w-full bg-gradient-to-r from-[#2a1b3d] to-[#1a0b2e] text-white shadow-lg z-20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16 items-center">
            <Link to="/" className="text-2xl font-bold tracking-tight">
              Passporter
            </Link>
            <div className="flex items-center">
              <div className="relative">
                <button
                  onClick={toggleNotifications}
                  className="text-white mr-4 flex items-center focus:outline-none"
                  aria-label="Notifications"
                >
                  <Bell className="h-6 w-6" />
                  {notifications.length > 0 && (
                    <span className="absolute top-0 right-0 h-5 w-5 bg-red-500 text-white text-xs rounded-full flex items-center justify-center">
                      {notifications.length}
                    </span>
                  )}
                </button>
                {showNotifications && (
                  <div className="absolute right-0 mt-2 w-80 bg-[#2a1b3d] bg-opacity-90 text-white rounded-lg shadow-lg glow-border z-30 max-h-96 overflow-y-auto">
                    <div className="p-4">
                      <h3 className="text-lg font-bold mb-2">Notifications</h3>
                      {notifications.length === 0 ? (
                        <p className="text-gray-400">No notifications.</p>
                      ) : (
                        <ul>
                          {notifications.map((notification) => (
                            <li
                              key={notification.id}
                              className="mb-2 p-2 bg-[#1a0b2e] bg-opacity-80 rounded-lg"
                            >
                              <p className="text-sm">{notification.message}</p>
                              <p className="text-xs text-gray-400">{notification.timestamp}</p>
                            </li>
                          ))}
                        </ul>
                      )}
                    </div>
                  </div>
                )}
              </div>
              <Link to="/student/profile" className="text-white mr-4">
                Profile
              </Link>
              <Link to="/student/apply-pass" className="text-white mr-4">
                Apply Pass
              </Link>
              <button
                onClick={handleLogout}
                className="glow-btn px-4 py-2"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </nav>
      <div className="flex-grow flex items-center justify-center p-6">
        <div className="glow-border p-8 rounded-lg max-w-md w-full text-center">
          <h2 className="text-3xl font-bold text-white mb-4">Student Dashboard</h2>
          <p className="text-gray-400">Welcome to your dashboard. Apply for a pass or view your profile.</p>
        </div>
      </div>
    </div>
  );
};

export default StudentDashboard;
